import './App.css';
import React from 'react';

import Login from './components/Login';
import { Link } from 'react-router-dom';
import { Sidebar, Menu, MenuItem, SubMenu } from 'react-pro-sidebar';


function App() {
  return (
    <>
      <Sidebar
        rootStyles={{
          [`.${sidebarClasses.container}`]: {
            backgroundColor: 'red',
          },
        }}
      >
      >
        <Menu
          menuItemStyles={{
            button: {
              [`&.active`]: {
                backgroundColor: '#13395e',
                color: '#b6c8d9',
              },
            },
          }}
        >
          <SubMenu label="Seção 1">
            <MenuItem component={<Link to="/documentation" />}> Nota 1 </MenuItem>
            <MenuItem> Nota 2 </MenuItem>
          </SubMenu>
          <SubMenu label="Seção 2">
            <MenuItem> Nota 1 </MenuItem>
            <MenuItem> Nota 2 </MenuItem>
          </SubMenu>
          <MenuItem> + Nova Seção </MenuItem>
        </Menu>
      </Sidebar>;
    </>
  );
}

export default App;
